INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "キャル", -363.0, 7001, 0, 7, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2015/12/17 15:00:00", 106001, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -363.0, 7002, 0, 7, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "ペコリーヌ", -363.0, 7003, 0, 7, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2015/12/17 15:00:00", 105801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "キャル", -363.0, 10001, 0, 10, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2015/12/17 15:00:00", 106001, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -363.0, 10002, 0, 10, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "ペコリーヌ", -363.0, 10003, 0, 10, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2015/12/17 15:00:00", 105801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "ペコリーヌ", -416.5, 12001, 0, 12, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2015/12/17 15:00:00", 105801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "キャル", -363.0, 13001, 0, 13, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2015/12/17 15:00:00", 106001, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -363.0, 13002, 0, 13, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "ペコリーヌ", -363.0, 13003, 0, 13, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2015/12/17 15:00:00", 105801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "キャル", -363.0, 14001, 0, 14, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2015/12/17 15:00:00", 106001, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -363.0, 14002, 0, 14, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "ペコリーヌ", -363.0, 14003, 0, 14, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2015/12/17 15:00:00", 105801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -470.0, 15001, 0, 15, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "キャル", -363.0, 16001, 0, 16, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2015/12/17 15:00:00", 106001, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -363.0, 16002, 0, 16, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "ペコリーヌ", -363.0, 16003, 0, 16, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2015/12/17 15:00:00", 105801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -363.0, 17002, 0, 17, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "キャル", -363.0, 17004, 0, 25, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2015/12/17 15:00:00", 106001, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -363.0, 17005, 0, 25, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "ペコリーヌ", -363.0, 17006, 0, 25, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2015/12/17 15:00:00", 105801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "カリン", -363.0, 18001, 0, 18, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 2, 1, "カリン", -363.0, 18002, 0, 18, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 3, 1, "カリン", -470.0, 19001, 0, 19, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 4, 1, "カリン", -470.0, 19002, 0, 19, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 5, 1, "カリン", -470.0, 20001, 0, 20, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 6, 1, "カリン", -470.0, 20002, 0, 20, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "キャル", -363.0, 21001, 0, 21, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2015/12/17 15:00:00", 106001, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "コッコロ", -363.0, 21002, 0, 21, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "2015/12/17 15:00:00", 105901, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "ペコリーヌ", -363.0, 21003, 0, 21, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2015/12/17 15:00:00", 105801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "カリン", -430.0, 22001, 0, 22, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 2, 1, "カリン", -430.0, 22002, 0, 22, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 3, 1, "カリン", -430.0, 23001, 0, 23, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 4, 1, "カリン", -430.0, 23002, 0, 23, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2015/12/17 15:00:00", 190801, 0.0, "2030/12/17 14:59:59", 0);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4.08, 1, 1, "エリコ（バレンタイン）", -385.0, 24001, 0, 24, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2019/01/31 12:00:00", 109001, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (5.0, 2, 1, "エリコ（バレンタイン）", -385.0, 24002, 0, 24, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2019/01/31 12:00:00", 109001, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10.11, 3, 1, "エリコ（バレンタイン）", -385.0, 24003, 0, 24, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2019/01/31 12:00:00", 109001, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4.0, 4, 1, "エリコ（バレンタイン）", -385.0, 24004, 0, 24, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2019/01/31 12:00:00", 109001, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (6.0, 5, 1, "エリコ（バレンタイン）", -385.0, 24005, 0, 24, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2019/01/31 12:00:00", 109001, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 6, 1, "エリコ（バレンタイン）", 0.0, 24006, 0, 24, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2019/01/31 12:00:00", 109002, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 7, 1, "エリコ（バレンタイン）", 0.0, 24007, 0, 24, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2019/01/31 12:00:00", 109002, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 8, 1, "エリコ（バレンタイン）", 0.0, 24008, 0, 24, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2019/01/31 12:00:00", 109002, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 9, 1, "エリコ（バレンタイン）", 0.0, 24009, 0, 24, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2019/01/31 12:00:00", 109002, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 10, 1, "エリコ（バレンタイン）", 0.0, 24010, 0, 24, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2019/01/31 12:00:00", 109002, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2.12, 1, 1, "シズル（バレンタイン）", -385.0, 24011, 0, 24, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2019/01/31 12:00:00", 109101, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4.19, 2, 5, "シズル（バレンタイン）", -385.0, 24012, 0, 24, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2019/01/31 12:00:00", 109101, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2.3, 3, 2, "シズル（バレンタイン）", -385.0, 24013, 0, 24, 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2019/01/31 12:00:00", 109101, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 4, 1, "シズル（バレンタイン）", 0.0, 24014, 0, 24, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2019/01/31 12:00:00", 109102, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (5.23, 5, 5, "シズル（バレンタイン）", -385.0, 24015, 0, 24, 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "2019/01/31 12:00:00", 109101, 8.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 6, 1, "シズル（バレンタイン）", 0.0, 24016, 0, 24, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2019/01/31 12:00:00", 109102, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (5.01, 7, 1, "シズル（バレンタイン）", -385.0, 24017, 0, 24, 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2019/01/31 12:00:00", 109101, 8.0, "2030/12/17 14:59:59", 10011);
