INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 9, 1, "シズル（バレンタイン）", 0.0, 24019, 0, 24, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2019/01/31 12:00:00", 109102, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 10, 1, "シズル（バレンタイン）", 0.0, 24020, 0, 24, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2019/01/31 12:00:00", 109102, 0.0, "2030/12/17 14:59:59", 10011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 1, 1, "キャル", -363.0, 26001, 0, 26, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "2015/12/17 15:00:00", 106001, 0.0, "2030/12/17 14:59:59", 0);
